const Homepage = () => {
  return (
      <div>
      <Routes>
        {/* Barre de navigation */}
            <li>
              <Link to="/">Accueil</Link>
            </li>
            <li>
              <Link to="/about">Ã€ propos</Link>
            </li>
            <li>
              <Link to="/contact">Contact</Link>
            </li>


        {/* Contenu de la page */}

          {/* Route pour la page d'accueil */}
          <Route exact path="/">
            <Homepage />
          </Route>
          </Routes> 
      </div>


  );
};

export default Homepage;
